import React, { useState, useEffect, useMemo } from 'react';
import axios from 'axios';
import {
  useReactTable,
  getCoreRowModel,
  getSortedRowModel,
  getFilteredRowModel,
  flexRender,
} from '@tanstack/react-table';
import NetworkModal from './NetworkModal';
import './NetworkTable.css';

const NetworkTable = () => {
  const [networks, setNetworks] = useState([]);
  const [globalFilter, setGlobalFilter] = useState('');
  const [selectedNetwork, setSelectedNetwork] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [isAddModalOpen, setIsAddModalOpen] = useState(false);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      setIsLoading(true);
      try {
        const response = await axios.get('http://127.0.0.1:5000/api/networks');
        setNetworks(response.data);
      } catch (err) {
        console.error('Error fetching networks:', err);
        setError('Failed to load data from the server.');
      } finally {
        setIsLoading(false);
      }
    };
    fetchData();
  }, []);

  const data = useMemo(() => networks, [networks]);

  const columns = useMemo(
    () => [
      { accessorKey: 'id', header: 'ID' },
      { accessorKey: 'name', header: 'Name' },
      { accessorKey: 'description', header: 'Description' },
      {
        accessorKey: 'color',
        header: 'Color',
        cell: ({ row }) => (
          <span
            style={{
              display: 'inline-block',
              width: '20px',
              height: '20px',
              backgroundColor: row.original.color || '#FFFFFF',
              border: '1px solid #000',
            }}
          ></span>
        ),
      },
      {
        id: 'actions',
        header: 'Actions',
        cell: ({ row }) => (
          <button onClick={() => handleMoreClick(row.original)}>More</button>
        ),
      },
    ],
    []
  );

  const table = useReactTable({
    data,
    columns,
    getCoreRowModel: getCoreRowModel(),
    getSortedRowModel: getSortedRowModel(),
    getFilteredRowModel: getFilteredRowModel(),
    state: {
      globalFilter,
    },
    onGlobalFilterChange: setGlobalFilter,
  });

  const handleMoreClick = (network) => {
    setSelectedNetwork(network);
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setSelectedNetwork(null);
    setIsModalOpen(false);
  };

  const handleAddNetwork = async (newNetwork) => {
    try {
      const response = await axios.post('http://127.0.0.1:5000/api/networks', newNetwork);
      setNetworks((prev) => [...prev, response.data]);
      setIsAddModalOpen(false);
    } catch (error) {
      console.error('Error adding network:', error);
      alert('Failed to add network. Please try again.');
    }
  };

  const handleUpdateNetwork = (updatedNetwork) => {
    setNetworks((prev) =>
      prev.map((network) =>
        network.id === updatedNetwork.id ? updatedNetwork : network
      )
    );
    setIsModalOpen(false);
  };

  const handleDeleteNetwork = async (id) => {
    if (window.confirm('Are you sure you want to delete this network?')) {
      try {
        await axios.delete(`http://127.0.0.1:5000/api/networks/${id}`);
        setNetworks((prev) => prev.filter((network) => network.id !== id));
      } catch (error) {
        console.error('Error deleting network:', error);
        alert('Failed to delete network. Please try again.');
      }
    }
  };

  if (isLoading) return <div>Loading...</div>;
  if (error) return <div style={{ color: 'red' }}>{error}</div>;

  return (
    <div>
      <div className="table-header">
        <input
          type="text"
          placeholder="Global Search..."
          value={globalFilter || ''}
          onChange={(e) => setGlobalFilter(e.target.value)}
          className="global-filter"
        />
        <button onClick={() => setIsAddModalOpen(true)} className="add-network-button">
          Add Network
        </button>
      </div>
      <div className="table-container">
        <table className="network-table">
          <thead>
            {table.getHeaderGroups().map((headerGroup) => (
              <tr key={headerGroup.id}>
                {headerGroup.headers.map((header) => (
                  <th key={header.id}>
                    {flexRender(header.column.columnDef.header, header.getContext())}
                  </th>
                ))}
              </tr>
            ))}
          </thead>
          <tbody>
            {table.getRowModel().rows.map((row) => (
              <tr key={row.id}>
                {row.getVisibleCells().map((cell) => (
                  <td key={cell.id}>
                    {flexRender(cell.column.columnDef.cell, cell.getContext())}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {isModalOpen && selectedNetwork && (
        <NetworkModal
          network={selectedNetwork}
          onClose={handleCloseModal}
          onUpdate={handleUpdateNetwork}
          onDelete={handleDeleteNetwork}
        />
      )}

      {isAddModalOpen && (
        <NetworkModal
          network={{}}
          onClose={() => setIsAddModalOpen(false)}
          onUpdate={handleAddNetwork}
        />
      )}
    </div>
  );
};

export default NetworkTable;
